def map_date(
    start   = gstart,
    end     = gend,
    ):
    def date_range(start_date,end_date):
        for n in range(int((end_date-start_date).days)):
            yield start_date+datetime.timedelta(n)
    
    q = []
    for i in date_range(start, end):
        i = (i.year, i.month, i.day)
        q.append(i)
    return q

